import React from 'react';

export default class QBData extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            items: []
        };
    }
    componentDidMount() {
        fetch('http://localhost:8080/getInventory', {method: 'GET'})
            .then(res => res.json())
            .then(items=>this.setState({items}))
            .catch(function(error) {
                console.log('There has been a problem with your fetch operation: ' + error.message);
                throw error;
            })
    }
    render() {
        const {items} = this.state;
        let itemArray = new Array(items.length);
        let i = 0;
        for(var key in items){
        itemArray[i] = items[key];
        i = i + 1;
        }

        const names = [];
        const itemNames = [];

        function f() {
            for(var x in itemArray[2]){
                var temp = itemArray[2][x];
                names[x] = temp;
            }
            console.log(itemNames);
        }

        f();

        return (
            names.map((names, index) => (
                <div style={{marginLeft:'500px'}} key={index}>{names}</div>
            ))
        );

    }
}
